import React, { useState } from 'react';
import { useSelector } from 'react-redux';
import { Routes, Route, Link } from 'react-router-dom';
import SignUp from './Signup';
import FetchUserData from './FetchUserData';
import SignIn from './SignIn';
import ProtectedPage from './ProtectedPage';
import FullCartView from './FullCartView';
import axios from 'axios';
import './App.css';

export const axiosInstance = axios.create({
  baseURL: 'https://api.example.com',
  timeout: 5000,
  headers: {
    'Content-Type': 'application/json',
    Authorization: 'Bearer YOUR_ACCESS_TOKEN',
  },
});

const App = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  const cartItems = useSelector((state) => state.cart); // Cart items from Redux store

  const handleLogout = () => {
    localStorage.removeItem('Accesstoken');
    setIsAuthenticated(false);
  };

  const toggleSidebar = () => {
    console.log("my sidebar is open")
    console.log(cartItems)
    setIsSidebarOpen(!isSidebarOpen);

  };

  return (
    <div className="app">
      <nav className="navbar">
        <div className="navbar-logo">
          <h1>MyApp</h1>
        </div>
        <ul className="navbar-links">
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/create-accountss">Create Account</Link>
          </li>
          <li>
            <Link to="/fetch-user-data">Fetch User Data</Link>
          </li>
          <li>
            <Link to="/SignIn">Sign In</Link>
          </li>
          <li>
            <Link to="/ProtectedPage">Protected Page</Link>
          </li>
        </ul>
        <button className="navbar-button" onClick={toggleSidebar}>
          Cart ({cartItems.itemCount})
        </button>
        <button className="navbar-button logout" onClick={handleLogout}>
          Logout
        </button>
      </nav>
      <div className={`sidebar ${isSidebarOpen ? 'open' : ''}`}>
        <h2>Cart Items</h2>
        {cartItems.itemCount > 0 ? (
          <ul>
            {cartItems.items.map((items, index) => (
              <li key={index}>
                {items.main_topic} 
              </li>
            ))}
          </ul>
        ) : (
          <p>Your cart is empty.</p>
        )}
        <button className="close-sidebar" onClick={toggleSidebar}>
          Close
        </button>
      </div>
      <div className={`content ${isSidebarOpen ? 'shifted' : ''}`}>
        <Routes>
          <Route path="/" element={<h1>Welcome to the App</h1>} />
          <Route path="/fetch-user-data" element={<FetchUserData />} />
          <Route path="/create-accountss" element={<SignUp />} />
          <Route path="/SignIn" element={<SignIn />} />
          <Route path="/FullCartView" element={<FullCartView />} />
          <Route
            path="/ProtectedPage"
            element={
              <ProtectedPage isAuthenticated={isAuthenticated}>
                <h2>Protected Page</h2>
                <p>This page is protected and requires authentication to access.</p>
              </ProtectedPage>
            }
          />
        </Routes>
      </div>
    </div>
  );
};

export default App;
